import React from 'react';

const Show = (props) => {

  return(
    <div>

      { props.type && <p>Job Type: { props.type }</p> }
      { props.url && <p>URL: { props.url }</p> }
      { props.created_at && <p>Created At: { props.created_at }</p> }
      { props.company && <p>Cmpany Name: { props.company }</p> }
      { props.company_url && <p>Company URL: { props.company_url }</p> }
      { props.location && <p>Job Location: { props.location }</p> }
      { props.job_title && <p>Job Title: { props.job_title }</p> }
      { props.description && <p>Job Description: { props.description }</p> }
      { props.company_logo && <p>Company Logo: { props.company_logo }</p> }
      { props.how_to_apply && <p>How to apply: { props.how_to_apply }</p> }
      { this.props.error && <p>{ this.props.error }</p> }

    </div>
  );

}


export default Show;
